import React from 'react';


const Nav = ({ links, switchContent, activeLink }) => {
  return (
    <div className="side-nav">
      {links.map(link => (
        <a
          key={link.id}  
          href="#"
          onClick={(e) => {
            e.preventDefault();
            switchContent(link.id);
          }}
          className={activeLink === link.id ? 'clink active' : 'clink'}
         >
           {link.text}
         </a>
       ))}
    </div>
  );
}

export default Nav;
